import React, { useState } from 'react';
import './navbar2.css';
import { Link } from 'react-router-dom';
import { FaInstagram, FaPhoneAlt } from 'react-icons/fa';

function Navbar2() {
  const [showMobileNumber, setShowMobileNumber] = useState(false);

  const handlePhoneIconClick = () => {
    setShowMobileNumber(!showMobileNumber);
  };

  return (
    <div className="hero1">
      <p>
        <nav className="nav2">
          <ul id="links13">
            <li>
              <a className="instalink" href="https://www.instagram.com/byjus_app/" target="_blank" rel="noopener noreferrer">
                <FaInstagram />
              </a>
            </li>
            <li>
              <a className="phlink" onClick={handlePhoneIconClick}>
                <FaPhoneAlt />
              </a>
            </li>
            {showMobileNumber && (
              <li className="mobileNumber">
                Mobile Number: <a href="tel:+91-9243500460">+91-9243500460</a>
              </li>
            )}
          </ul>
        </nav>
      </p>
    </div>
  );
}

export default Navbar2;
